import React from "react";
import { Link } from "react-router-dom";
import brigado from './copo.svg';

// Components
import Header from './header';


const Obrigado = () => {
    return (
        <>
            <Header/>
            <main>
            <img src="{brigado}" alt="" />
            </main>

            </>
    )
}
export default Obrigado;
